import React, {useState, useEffect} from 'react'

function Login() {
  const [username, setUsername] = useState('')
  const [password, setPassword] = useState('')

 const  getCookie =(name)  => {
    var cookieValue = null;
    if (document.cookie && document.cookie !== '') {
        var cookies = document.cookie.split(';');
        for (var i = 0; i < cookies.length; i++) {
            var cookie = cookies[i].trim();
            // Does this cookie string begin with the name we want?
            if (cookie.substring(0, name.length + 1) === (name + '=')) {
                cookieValue = decodeURIComponent(cookie.substring(name.length + 1));
                break;
            }
        }
    }
    return cookieValue;
}

const  handleUsername =(e) =>{


    var username = e.target.value

    console.log('Username:', username)


    this.setState({
      login:{
        ...this.state.login,
        username:username,

      }
    })
  }

 const  handlePassword = (e) =>{

    var password = e.target.value

    console.log('Password:', password)

    this.setState({
      login:{
        ...this.state.login,

        password:password
      }
    })
  
  }


 const handleSubmit = (e) =>{
    e.preventDefault()
    console.log('ITEM:', this.state.login)
    let name_user= this.state.login.username
    var csrftoken = this.getCookie('csrftoken')

    var url = 'http://127.0.0.1:8000/account/login/'

    fetch(url, {
      method:'POST',
      headers:{
        'Content-type':'application/json',
        'X-CSRFToken':csrftoken,
      },
      body:JSON.stringify(this.state.login)
    }).then((response)  => {
        console.log(response)
        this.props.getUsername(name_user)
        this.setState({
           login:{
          username:'', 
          password:'',

        }
        })
    }).catch(function(error){
      console.log('ERROR:', error)
    })

  }
  return (
    <>
    <div className="container">
      <div className="row">
        <div className="col-md-3"></div>
        <div className="col-md-6">
        <h3>Login</h3>
          <form action="" onSubmit={handleSubmit} >
            <div className="form-group">
            <label htmlFor="id_username">Username</label>
            <input  onChange={handleUsername} type="text"  className="form-control"  name="username"   autoFocus=""  required="" id="id_username"/>
            </div>
            <div className="form-group">
            <label htmlFor="id_password">Password</label>
            <input  onChange={handlePassword} className="form-control " type="password" name="password"   required="" id="id_password" />

            </div>
            <div className="form-group">
            <button className='btn btn-dark w-100' type="submit">Login</button>
            </div>
          </form>
        </div>
      </div>
    </div>
        
</>
  )
}

export default Login














